DROP TABLE IF EXISTS `pokemon_form_names`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pokemon_form_names` (
  `pokemon_form_id` int(5) NOT NULL,
  `local_language_id` int(2) NOT NULL,
  `form_name` varchar(20) DEFAULT NULL,
  `pokemon_name` varchar(28) DEFAULT NULL,
  PRIMARY KEY (`pokemon_form_id`,`local_language_id`),
  KEY `FK_pokemon_form_lang` (`local_language_id`),
  CONSTRAINT `FK_pokemon_form_lang` FOREIGN KEY (`local_language_id`) REFERENCES `languages` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `FK_pokemon_form_pokemon_form` FOREIGN KEY (`pokemon_form_id`) REFERENCES `pokemon_forms` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;
