DROP TABLE IF EXISTS `pokemon_forms`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pokemon_forms` (
  `id` int(5) NOT NULL,
  `identifier` varchar(26) DEFAULT NULL,
  `form_identifier` varchar(18) DEFAULT NULL,
  `pokemon_id` int(5) DEFAULT NULL,
  `introduced_in_version_group_id` int(2) DEFAULT NULL,
  `is_default` int(1) DEFAULT NULL,
  `is_battle_only` int(1) DEFAULT NULL,
  `is_mega` int(1) DEFAULT NULL,
  `form_order` int(2) DEFAULT NULL,
  `order` int(4) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `identifier` (`identifier`),
  KEY `FK_pokemon_forms_pokemon` (`pokemon_id`),
  CONSTRAINT `FK_pokemon_forms_pokemon` FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

